import React from 'react';


import { useSelector, useDispatch } from 'react-redux'
import { userlist} from '../features/counter/counterSlice'

function Jadhav() {
    const jadhavtext = useSelector((state) => state.alluserdata.value);
    const dispatch = useDispatch()
    return (
      <div>
          User info = {jadhavtext?.userinfo.email}
         {
         /*    console.log(jadhavtext?.userinfo) */
         }
              <button onClick={() => dispatch(userlist())} > Get List </button> 
      </div>
    );
  }

  export default Jadhav;
